void Net::ASN1OIDDB::OIDToNameString(const UInt8 *pdu, UOSInt pduSize, Text::StringBuilderUTF *sb)
{
	Net::ASN1OIDDB::OIDInfo *oid;
	UInt32 v;
	UOSInt checkSize = pduSize;
	while (checkSize > 0)
	{
		oid = OIDGetEntry(pdu, checkSize);
		if (oid)
		{
			sb->Append((const UTF8Char*)oid->name);
			v = 0;
			while (checkSize < pduSize)
			{
				v = (v << 7) | (pdu[checkSize] & 0x7f);
				if ((pdu[checkSize] & 0x80) == 0)
				{
					sb->AppendChar('.', 1);
					sb->AppendU32(v);
					v = 0;
				}
				checkSize++;
			}
			return;
		}
		checkSize--;
	}
}

Net::ASN1OIDDB::OIDInfo *Net::ASN1OIDDB::OIDGetEntry(const UInt8 *pdu, UOSInt pduSize)
{
	Net::ASN1OIDDB::OIDInfo *oid;
	OSInt i = 0;
	OSInt j = (OSInt)(sizeof(oidList) / sizeof(oidList[0])) - 1;
	OSInt k;
	OSInt l;
	while (i <= j)
	{
		k = (i + j) >> 1;
		oid = &oidList[k];
		l = Net::ASN1Util::OIDCompare(pdu, pduSize, oid->oid, oid->len);
		if (l > 0)
		{
			i = k + 1;
		}
		else if (l < 0)
		{
			j = k - 1;
		}
		else
		{
			return oid;
		}
	}
	return 0;
}
